import React, {Component} from 'react';

class PokemonCard extends Component {

    state = {
        name: '',
        imageUrl: '',
        pokemonIndex: ''
    };

    componentDidMount() {
        let { url, name } = this.props;
    }

    render() {
        return (
            <div className='col-md-3 col-sm-6 mb-5'>
                <div className={'card'}>
                    <div className="card-header">
                        <h1>{name}</h1>
                    </div>
                </div>
            </div>
        );
    }
}

export default PokemonCard;
